INSERT INTO `videos` (`id`, `video_name`, `designation_id`, `description`, `file`, `created_at`, `updated_at`) VALUES
(1, 'How to Get Bages', NULL, '<h2>How to Get Bages&nbsp;</h2>\r\n\r\n<div class=\"float-right\" style=\"margin-left: 20px;\"><img alt=\"Image result for badges\" src=\"data:image/jpeg;base64,\" style=\"float: right;\" /></div>\r\n\r\n<p><strong>Apollo 11</strong> was the spaceflight that landed the first humans, Americans <a href=\"#\">Neil Armstrong</a> and <a href=\"#\">Buzz Aldrin</a>, on the Moon on July 20, 1969, at 20:18 UTC. Armstrong became the first to step onto the lunar surface 6 hours later on July 21 at 02:56 UTC.</p>\r\n\r\n<p class=\"mb-3\">Armstrong spent about <s>three and a half</s> two and a half hours outside the spacecraft, Aldrin slightly less; and together they collected 47.5 pounds (21.5&nbsp;kg) of lunar material for return to Earth. A third member of the mission, <a href=\"#\">Michael Collins</a>, piloted the <a href=\"#\">command</a> spacecraft alone in lunar orbit until Armstrong and Aldrin returned to it for the trip back to Earth.</p>\r\n\r\n<h5 class=\"font-weight-semibold\">Technical details</h5>\r\n\r\n<p>Launched by a <strong>Saturn V</strong> rocket from <a href=\"#\">Kennedy Space Center</a> in Merritt Island, Florida on July 16, Apollo 11 was the fifth manned mission of <a href=\"#\">NASA</a>&#39;s Apollo program. The Apollo spacecraft had three parts:</p>\r\n\r\n<ol>\r\n	<li><strong>Command Module</strong> with a cabin for the three astronauts which was the only part which landed back on Earth</li>\r\n	<li><strong>Service Module</strong> which supported the Command Module with propulsion, electrical power, oxygen and water</li>\r\n	<li><strong>Lunar Module</strong> for landing on the Moon.</li>\r\n</ol>\r\n\r\n<p class=\"mb-3\">After being sent to the Moon by the Saturn V&#39;s upper stage, the astronauts separated the spacecraft from it and travelled for three days until they entered into lunar orbit. Armstrong and Aldrin then moved into the Lunar Module and landed in the <a href=\"#\">Sea of Tranquility</a>. They stayed a total of about 21 and a half hours on the lunar surface. After lifting off in the upper part of the Lunar Module and rejoining Collins in the Command Module, they returned to Earth and landed in the <a href=\"#\">Pacific Ocean</a> on July 24.</p>\r\n\r\n<h5 class=\"font-weight-semibold\">Mission crew</h5>\r\n\r\n<table class=\"table table-bordered\" style=\"width: 100%\">\r\n	<thead>\r\n		<tr>\r\n			<th>Position</th>\r\n			<th>Astronaut</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Commander</td>\r\n			<td>Neil A. Armstrong</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Command Module Pilot</td>\r\n			<td>Michael Collins</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lunar Module Pilot</td>\r\n			<td>Edwin &quot;Buzz&quot; E. Aldrin, Jr.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Source: <a href=\"http://en.wikipedia.org/wiki/Apollo_11\">Wikipedia.org</a></p>\r\n', NULL, '2020-01-24 09:33:56', '2020-02-07 17:41:38'),
(2, 'How to Get Hulk Badge', NULL, '<h2>How to Get Hulk Badge</h2>\r\n\r\n<p class=\"float-right\" style=\"margin-left: 20px;\"><img alt=\"Image result for badges\" src=\"https://comps.canstockphoto.com/set-of-military-army-badges-vector-eps-vector_csp55833543.jpg\" style=\"width: 100px; height: 104px; float: right;\" />​​​A badge is a device or accessory, often containing the insignia of an organization, which is presented or displayed to indicate some feat of service, a special accomplishment, a symbol of authority granted by taking an oath, a sign of legitimate employment or student status, or as a simple means of identification.</p>\r\n', NULL, '2020-02-07 17:40:11', '2020-02-07 17:40:11'),
(3, NULL, NULL, NULL, NULL, '2020-02-07 22:06:26', '2020-02-07 22:06:26'),
(4, 'Hoisting How to', NULL, '<pre class=\"prettyprint linenums lang-html \" data-pbcklang=\"html\" data-pbcktabsize=\"4\">\r\nhttps://youtu.be/T5KQAc6ufOw</pre>\r\n\r\n<p><img alt=\"\" src=\"https://d1zgdcrdir5wgt.cloudfront.net/media/vehicle/images/QZQNTaNHTYSu4pS3xr8-9g.1440x700.jpg\" style=\"width: 1440px; height: 700px;\" /></p>\r\n\r\n<h1>Step 1:</h1>\r\n\r\n<p><strong>Apollo 11</strong> was the spaceflight that landed the first humans, Americans <a href=\"#\">Neil Armstrong</a> and <a href=\"#\">Buzz Aldrin</a>, on the Moon on July 20, 1969, at 20:18 UTC. Armstrong became the first to step onto the lunar surface 6 hours later on July 21 at 02:56 UTC.</p>\r\n\r\n<p class=\"mb-3\">Armstrong spent about <s>three and a half</s> two and a half hours outside the spacecraft, Aldrin slightly less; and together they collected 47.5 pounds (21.5&nbsp;kg) of lunar material for return to Earth. A third member of the mission, <a href=\"#\">Michael Collins</a>, piloted the <a href=\"#\">command</a> spacecraft alone in lunar orbit until Armstrong and Aldrin returned to it for the trip back to Earth.</p>\r\n\r\n<h5 class=\"font-weight-semibold\">Technical details</h5>\r\n\r\n<h1><strong>Step 2:</strong></h1>\r\n\r\n<p>Launched by a <strong>Saturn V</strong> rocket from <a href=\"#\">Kennedy Space Center</a> in Merritt Island, Florida on July 16, Apollo 11 was the fifth manned mission of <a href=\"#\">NASA</a>&#39;s Apollo program. The Apollo spacecraft had three parts:</p>\r\n\r\n<ol>\r\n	<li><strong>Command Module</strong> with a cabin for the three astronauts which was the only part which landed back on Earth</li>\r\n	<li><strong>Service Module</strong> which supported the Command Module with propulsion, electrical power, oxygen and water</li>\r\n	<li><strong>Lunar Module</strong> for landing on the Moon.</li>\r\n</ol>\r\n\r\n<p class=\"mb-3\">After being sent to the Moon by the Saturn V&#39;s upper stage, the astronauts separated the spacecraft from it and travelled for three days until they entered into lunar orbit. Armstrong and Aldrin then moved into the Lunar Module and landed in the <a href=\"#\">Sea of Tranquility</a>. They stayed a total of about 21 and a half hours on the lunar surface. After lifting off in the upper part of the Lunar Module and rejoining Collins in the Command Module, they returned to Earth and landed in the <a href=\"#\">Pacific Ocean</a> on July 24.</p>\r\n\r\n<h5 class=\"font-weight-semibold\">Mission crew</h5>\r\n\r\n<table class=\"table table-bordered\" style=\"width: 100%\">\r\n	<thead>\r\n		<tr>\r\n			<th>Position</th>\r\n			<th>Astronaut</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Commander</td>\r\n			<td>Neil A. Armstrong</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Command Module Pilot</td>\r\n			<td>Michael Collins</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Lunar Module Pilot</td>\r\n			<td>Edwin &quot;Buzz&quot; E. Aldrin, Jr.</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Source: <a href=\"http://en.wikipedia.org/wiki/Apollo_11\">Wikipedia.org</a></p>\r\n', NULL, '2020-02-07 22:08:22', '2020-02-07 22:08:22');
